    <script>
        const starCount = 500;
        const stars = [];
        const maxSpeed = 0.01;
        function createStar() {
            const star = document.createElement('div');
            star.className = 'star';
            const startPosition = {
                x: window.innerWidth / 2,
                y: window.innerHeight / 2
            };
            const angle = Math.random() * 2 * Math.PI;
            const distance = Math.random() * window.innerWidth * 0.5;
            const speed = Math.random() * maxSpeed + 0.001;
            star.style.left = startPosition.x + 'px';
            star.style.top = startPosition.y + 'px';
            const brightness = Math.min(255, 255 * (0.2 + 0.8 * (1 - distance / (window.innerWidth * 0.5))));
            star.style.backgroundColor = `rgb(${brightness}, ${brightness}, ${brightness})`;
            stars.push({ element: star, angle, distance, speed, size: 1, brightness, opacity: 0 });
            document.body.appendChild(star);
        }
        function updateStars() {
            for (const star of stars) {
                star.distance += star.speed * 10;
                star.size += star.speed * 0.05;
                const x = window.innerWidth / 2 + star.distance * Math.cos(star.angle);
                const y = window.innerHeight / 2 + star.distance * Math.sin(star.angle);
                star.element.style.left = x + 'px';
                star.element.style.top = y + 'px';
                star.element.style.width = star.size + 'px';
                star.element.style.height = star.size + 'px';
                const brightness = Math.min(255, 255 * (0.2 + 0.8 * (1 - star.distance / (window.innerWidth * 0.5)))) - 50;
                star.element.style.backgroundColor = `rgb(${brightness}, ${brightness}, ${brightness})`;
                if (star.opacity < 1) {
                    star.opacity += 0.01;
                    star.element.style.opacity = star.opacity;
                }
                if (
                    x < 0 || x > window.innerWidth ||
                    y < 0 || y > window.innerHeight
                ) {
                    star.element.remove();
                    stars.splice(stars.indexOf(star), 1);
                }
            }
        }
        function animate() {
            updateStars();
            requestAnimationFrame(animate);
        }
        for (let i = 0; i < starCount; i++) {
            createStar();
        }
        setInterval(() => {
            createStar();
        }, 50);
        animate();
        function tryPlayAudio() {
            var audio = document.getElementById("soon");
            audio.play().then(() => {
                document.removeEventListener('click', tryPlayAudio);
                document.removeEventListener('keydown', tryPlayAudio);
            })
        }
        window.onload = tryPlayAudio;
        document.addEventListener('click', tryPlayAudio);
        document.addEventListener('keydown', tryPlayAudio);
